import { ref } from 'vue';

export const myMixin = {
  data() {
    return {
      myVariable: ref(null),
    };
  },
  methods: {
    rowSelectListener() {
      console.log(this.myVariable.value);
      const methods = this.$options.methods;
      for (const methodName in methods) {
        const method = methods[methodName];
        if (method?.rowSelect) {
          method.rowSelect();
        }
      }
    },
  },
};
